import Sidebar from "./components/sidebar/Sidebar"
import "./app.css"
import Home from './pages/home/Home'
// import axios from "axios";

function App() {
  return (
    <Router>
      <div className="App">
        <Topbar />
        <div className="container">
          <Sidebar />
          <Routes>
            <Route path='/' element={<Home />} />
